import React from "react";

function Header() {
  return (
    <header>
      <nav>
        <div className="logo">
          <img src="" alt="Logo" />
          <p>SuGa</p>
        </div>
        <button className="Nav-link">SignIn</button>
      </nav>
    </header>
  );
}
export default Header;
